import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component() {

  SearchMixCloud = async searchTerm => {
    try {
      const response = await fetch('https://api.mixcloud.com/searchTerm/');
      const data = response.json();
      console.log(data);
    } catch (error) {
      console.log("nothing.");
    }
  }

  render() {

  }
}


export default App;
